import React from "react";

const SignatureDish: React.FC<{
  key: string;
  signatureName: string;
  signatureImage: string;
  signatureDescription: string;
  icon: string;
  price: number;
}> = (props) => {
  return (
    <div className="popular-item">
      <img src={props.signatureImage} alt="popular-img"></img>
      <h2>{props.signatureName}</h2>
      <p>{props.signatureDescription}</p>
      <img src={props.icon} alt="icon"></img>
      <p>{props.price}</p>
    </div>
  );
};

export default SignatureDish;
